import './producttile.scss'
import material from '../../../../assets/Products/product-main/tiles/material.svg'

const ProductTile = () => {
    return(
        <div class='tile'>
            <img src={material} />
            <div className='tile-desc'>
                Opis
            </div>
        </div>
    )
}

export default ProductTile
